// background.js

/**
 * formats/cleans the timeslots w/ only necessary fields e.g. day, time, location etc.
 */
function formatTimeslots(activityTimeslots) {
  const formattedTimeslots = [];
  for (const timeslot in activityTimeslots) {
    const timeslotData = activityTimeslots[timeslot];
    formattedTimeslots.push({
      day: timeslotData.day_of_week,
      time: timeslotData.start_time,
      location: timeslotData.location,
      duration: timeslotData.duration,
      description: timeslotData.description.replace(/[^\x20-\x7E]/g, ""),
      classType: timeslotData.activity_group_code,
    });
  }

  return formattedTimeslots;
}

/**
 * organises the classes into their corresponding semesters
 */
function organiseStudentData(studentData) {
  const organisedData = {};
  // find all semesters that selected courses are in

  for (const activity in studentData) {
    // console.log(studentData[activity]);
    // check which semester this activity is in
    const activityData = studentData[activity];

    // get the semester from the first available activity
    const firstKey = Object.keys(activityData)[0];

    const semesterOfActivity = activityData[firstKey].semester_description;

    // get timeslots of the activity
    const activityTimeslots = activityData;

    // format each of the timeslots with necessary fields
    const formattedTimeslots = formatTimeslots(activityTimeslots);

    // push the formatted timeslots to the array that corresponds to the activity's semester

    // If this semester doesn't exist in the object yet, create an empty array
    if (!organisedData[semesterOfActivity]) {
      organisedData[semesterOfActivity] = [];
    }

    // Add all formatted timeslots to the right semester
    organisedData[semesterOfActivity].push(formattedTimeslots);
  }

  return organisedData;
}

/**
 * Listens to see if allocate data is found
 * - formats data
 * - stores it in extension local storage
 */
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  if (message.type === "ALLOCATE_DATA_FOUND") {
    console.log("Student allocate data found", message.data);
    console.log(message.data.newPreferences);
    // get session token
    chrome.tabs.query({ active: true, currentWindow: true }, async (tabs) => {
      const match = tabs[0].url.match(/ss=([^#]+)/);
      const sessionToken = match ? match[1] : null;

      const activityGrpDetails = message.data.sorted_display;
      const studentCode = message.data.student_code;

      const activityGroupData = await getActivityGroupData(
        activityGrpDetails,
        studentCode,
        sessionToken
      );
      console.log(activityGroupData);
      // format the data and separate them into their semesters
      const organisedData = organiseStudentData(activityGroupData);
      console.log(organisedData);
      // store to later access it
      chrome.storage.local.set({ allocateData: organisedData });
    });
  }
});

/**
 * Uses the page source data pertaining to students enrolled subjects
 * to build a HTTP request to get class time data for each subject
 */
async function getActivityGroupData(
  activityGrpDetails,
  studentCode,
  sessionToken
) {
  let activityGroupData = {};

  const fetches = Object.keys(activityGrpDetails).map(async (group) => {
    const groupDetail = group.split("||");
    const subjectCode = groupDetail[0];
    const activityCode = groupDetail[1];

    try {
      const response = await fetch(
        `https://mytimetable.rmit.edu.au/odd/rest/student/${studentCode}/subject/${subjectCode}/group/${activityCode}/activities/?ss=${sessionToken}`
      );

      if (!response.ok) {
        console.warn(
          `Unable to fetch data for: ${subjectCode}, ${activityCode}`
        );
        return;
      }

      const data = await response.json();

      // Add to the object using the original group key
      activityGroupData[group] = data;
    } catch (error) {
      console.error(`Error fetching ${subjectCode} ${activityCode}:`, error);
    }
  });

  await Promise.all(fetches);

  return activityGroupData;
}

